import { useState, useEffect } from "react";
import { motion } from "framer-motion";

function NavLink({ children }) {
    return (
        <a href="#" className="px-4 py-2 hover:text-teal-400 transition-colors font-medium">
            {children}
        </a>
    );
}

export default function App() {
    const [dark, setDark] = useState(true);
    const [logoColors, setLogoColors] = useState([
        "from-teal-700",
        "via-fuchsia-700",
        "to-indigo-700"
    ]);

    const toggleTheme = () => setDark(!dark);

    // Animation des couleurs du logo
    useEffect(() => {
        const colors = [
            ["from-teal-700", "via-fuchsia-700", "to-indigo-700"],
            ["from-purple-700", "via-pink-700", "to-red-700"],
            ["from-blue-700", "via-green-700", "to-yellow-600"],
            ["from-indigo-700", "via-purple-700", "to-pink-700"]
        ];

        const interval = setInterval(() => {
            setLogoColors(colors[Math.floor(Math.random() * colors.length)]);
        }, 3000);

        return () => clearInterval(interval);
    }, []);

    const navItems = ["Accueil", "Projets", "Processus", "Expertise", "Contact"];

    return (
        <div className={`min-h-screen ${dark ? "bg-black text-white" : "bg-white text-black"}`}>
            {/* Barre de navigation */}
            <header className="flex justify-between items-center p-6">
                {/* Logo centré */}
                <div className="absolute left-1/2 transform -translate-x-1/2">
                    <div className="flex items-center gap-3">
                        <div className={`w-10 h-10 bg-gradient-to-tr ${logoColors.join(" ")} rounded-md grid grid-cols-2 grid-rows-2`}>
                            <div className="bg-teal-700 rounded-bl-[100%]" />
                            <div className="bg-fuchsia-700 rounded-br-[100%]" />
                            <div className="bg-indigo-700 rounded-tl-[100%]" />
                            <div className="bg-yellow-600 rounded-tr-[100%]" />
                        </div>
                        <h1 className="text-xl font-bold tracking-wide">Beyond</h1>
                    </div>
                </div>

                {/* Menu */}
                <nav className="flex items-center gap-1">
                    {navItems.map((item) => (
                        <NavLink key={item}>{item}</NavLink>
                    ))}
                </nav>

                {/* Bouton Dark Mode */}
                <button
                    onClick={toggleTheme}
                    className="p-2 rounded-full hover:bg-gray-800 transition-colors"
                    aria-label="Toggle dark mode"
                >
                    {dark ? (
                        <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5" viewBox="0 0 20 20" fill="currentColor">
                            <path fillRule="evenodd" d="M10 2a1 1 0 011 1v1a1 1 0 11-2 0V3a1 1 0 011-1zm4 8a4 4 0 11-8 0 4 4 0 018 0zm-.464 4.95l.707.707a1 1 0 001.414-1.414l-.707-.707a1 1 0 00-1.414 1.414zm2.12-10.607a1 1 0 010 1.414l-.706.707a1 1 0 11-1.414-1.414l.707-.707a1 1 0 011.414 0zM17 11a1 1 0 100-2h-1a1 1 0 100 2h1zm-7 4a1 1 0 011 1v1a1 1 0 11-2 0v-1a1 1 0 011-1zM5.05 6.464A1 1 0 106.465 5.05l-.708-.707a1 1 0 00-1.414 1.414l.707.707zm1.414 8.486l-.707.707a1 1 0 01-1.414-1.414l.707-.707a1 1 0 011.414 1.414zM4 11a1 1 0 100-2H3a1 1 0 000 2h1z" clipRule="evenodd" />
                        </svg>
                    ) : (
                        <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5" viewBox="0 0 20 20" fill="currentColor">
                            <path d="M17.293 13.293A8 8 0 016.707 2.707a8.001 8.001 0 1010.586 10.586z" />
                        </svg>
                    )}
                </button>
            </header>

            {/* Section Hero */}
            <section className="container mx-auto px-6 py-32 text-center">
                <motion.div
                    initial={{ opacity: 0, y: 20 }}
                    animate={{ opacity: 1, y: 0 }}
                    transition={{ duration: 0.8 }}
                >
                    <h1 className="text-5xl md:text-7xl font-bold mb-6">
                        Donnez vie à votre vision digitale
                    </h1>
                    <p className="text-xl md:text-2xl max-w-3xl mx-auto mb-10">
                        Beyond crée des expériences web uniques qui marquent les esprits et transforment les visiteurs en clients.
                    </p>

                    <div className="flex justify-center gap-6">
                        <button className="px-8 py-3 bg-teal-600 hover:bg-teal-700 rounded-full text-white font-medium transition-colors">
                            Démarrer un projet
                        </button>
                        <button className="px-8 py-3 border border-gray-300 dark:border-gray-700 hover:bg-gray-100 dark:hover:bg-gray-800 rounded-full font-medium transition-colors">
                            Explorer notre travail
                        </button>
                    </div>
                </motion.div>
            </section>

            {/* Note en bas de page */}
            <footer className="fixed bottom-4 left-4 bg-white dark:bg-gray-800 p-3 rounded-lg shadow-lg border dark:border-gray-700">
                <div className="flex items-center gap-2">
                    <input type="checkbox" className="rounded" />
                    <span className="text-sm">Althos 2.0 - Free Farmer LIX Portfolio Template</span>
                </div>
            </footer>
        </div>
    );
}
